package string_manipulation

import "testing"

func TestMakeAnagram(t *testing.T) {
	var tests = []struct {
		a        string
		b        string
		expected int32
	}{
		{"cde", "dcf", 2},
		{"cde", "abc", 4},
	}

	for _, test := range tests {
		if result := makeAnagram(test.a, test.b); result != test.expected {
			t.Errorf("makeAnagram(%s, %s) = %d, expected = %d", test.a, test.b, result, test.expected)
		}
	}
}

func TestAlternatingCharacters(t *testing.T) {
	var tests = []struct {
		s        string
		expected int32
	}{
		{"AABAAB", 2},
		{"AAAA", 3},
		{"BBBBB", 4},
		{"ABABABAB", 0},
		{"BABABA", 0},
		{"AAABBB", 4},
	}

	for _, test := range tests {
		if result := alternatingCharacters(test.s); result != test.expected {
			t.Errorf("alternatingCharacters(%s) = %d, expected = %d", test.s, result, test.expected)
		}
	}
}

func TestIsValid(t *testing.T) {
	var tests = []struct {
		s        string
		expected string
	}{
		{"abc", "YES"},
		{"abcc", "YES"},
		{"abccc", "NO"},
		{"aabbcd", "NO"},
		{"aabbccddeefghi", "NO"},
		{"abcdefghhgfedecba", "YES"},
	}

	for _, test := range tests {
		if result := isValid(test.s); result != test.expected {
			t.Errorf("isValid(%s) = %s, expected = %s", test.s, result, test.expected)
		}
	}
}

func TestSubstrCount(t *testing.T) {
	var tests = []struct {
		n        int32
		s        string
		expected int64
	}{
		{8, "mnonopoo", 12},
		{5, "asasd", 7},
		{7, "abcbaba", 10},
		{4, "aaaa", 10},
		{727310, "", 1272919},
	}

	for _, test := range tests {
		if result := substrCount(test.n, test.s); result != test.expected {
			t.Errorf("substrCount(%d, %s) = %d, expected = %d", test.n, test.s, result, test.expected)
		}
	}
}

func TestCommonChild(t *testing.T) {
	var tests = []struct {
		s1       string
		s2       string
		expected int32
	}{
		{"ABCD", "ABDC", 3},
		{"HARRY", "SALLY", 2},
		{"AA", "BB", 0},
		{"SHINCHAN", "NOHARAAA", 3},
		{"ABCDEF", "FBDAMN", 2},
		{"WEWOUCUIDGCGTRMEZEPXZFEJWISRSBBSYXAYDFEJJDLEBVHHKS", "FDAGCXGKCTKWNECHMRXZWMLRYUCOCZHJRRJBOAJOQJZZVUYXIC", 15},
	}

	for _, test := range tests {
		if result := commonChild(test.s1, test.s2); result != test.expected {
			t.Errorf("commonChild(%s, %s) = %d, expected = %d", test.s1, test.s2, result, test.expected)
		}
	}
}
